import React from "react";
import ConCard from "./Con-Card";
import image from "./mask-group-nuo.png";

function Cards() {
  const obj = [
    { id: 3, img: image, name: "ayman", phone: "+684 34546543" },
    {
      id: 4,
      img: image,
      name: "mugahe",
      phone: "+684 546745774",
      email: "sds@gmain.ocom",
    },
    {
      id: 6,
      img: image,
      name: "mohsen",
      phone: "+684 234546546",
      email: "sds@gmain.ocom",
    },
    { id: 5, img: image, name: "ahlam", phone: "+684 234546546" },
    {
      id: 1,
      img: image,
      name: "tamer",
      phone: "+684 234546546",
      email: "sds@gmain.ocom",
    },
    { id: 2, img: image, name: "ola", phone: "+684 898785675" },
  ];

  //   const member = obj.map(function (e) {
  //     return (
  //       <ConCard
  //         key={e.id}
  //         name={e.name}
  //         img={e.img}
  //         phone={e.phone}
  //         email={e.email}
  //       />
  //     );
  //   });
  const member = obj.map((e) => (
    <ConCard
      key={e.id}
      name={e.name}
      img={e.img}
      phone={e.phone}
      email={e.email}
    />
  ));

  return (
    <div className="container mt-4 rounded " style={{ background: "red" }}>
      <div className="row">{member}</div>
    </div>
  );
}

export default Cards;
